パッケージの追加com.Light.CopperTools.regi.tab tabにタブのmainクラスを作成(tabの中身を管理をする) CopperToolsMain package com.Light.CopperTools.regi.tab; import net.minecraft.world.item.Item;
import net.minecraft.world.item.ItemStack;
