} CopperTools.javaにクリエイティブモードタブを登録 public CopperTools(){ IEventBus bus = FMLJavaModLoadingContext.get().getModEventBus(); CopperToolsTabs.MOD_TABS.register(bus); } ランチャーを起動してクリエイティブモードタブが登録されているか確認
